import React from 'react';
import DialogContent from '@mui/joy/DialogContent';
import _ from 'lodash'



export default function SumBalance({playersData}) {
    const totalIn = _.sumBy(playersData, p => typeof p.start_balance === 'number' ? p.start_balance : 0)
    const totalOut = _.sumBy(playersData, p => typeof p.end_balance === 'number' ? p.end_balance : 0)

    const totalZero = totalOut === totalIn
    const text = `The sum of in and out is ${totalOut - totalIn}`

    return(
        <DialogContent>{text}</DialogContent>
       )

}
